def extract_data(datas):
    clean_data = []
    for idx, data in enumerate(datas):
        temp=data.split(",")
        file_name=temp[0]
        del temp[0]

        student = Student(file_name, temp)
        # print(file_name + "------>" + str(temp))
        clean_data.append(student)

    return clean_data

def fill_data(data):
    for i in datas:
        wb = xlwt.Workbook()
        statistic_sheet = wb.add_sheet('Số liệu', cell_overwrite_ok=True)
        percent_sheet = wb.add_sheet("Phần trăm", cell_overwrite_ok=True)
        for idx, question in enumerate(i.questions):
            text=""
            if question.startswith("KN"):
                text=question
            else:
                text="Cau" + question
            statistic_sheet.write(0, idx, text)
            percent_sheet.write(0, idx, text)

        wb.save(i.file_name + ".xls")

if __name__ == '__main__':
    datas=extract_data(data)

    fill_data(datas)

